tendanceStation = function(station, time) {
	var currentIndex, nextIndex;
	currentIndex = time.getHours()(4 + Math.floor(time.getMinutes()(4 / 60)));
	nextIndex = currentIndex + 1;
	if (nextIndex + 1 > station.profile.length) {
		nextIndex = 0;
	}
	return station.profile[nextIndex] - station.profile[currentIndex];
};

isStationÉquilibrée = function(station) {
	return station.bikeNum > station.slotNum / 4 && station.bikeNum < station.slotNum / 4 * 3;
};

isStationSecure = function(station, sécurité) {
	return deltaCible(station, .75) >= sécurité && deltaCible(station, .25) <= -sécurité;
};

deltaCible = function(entité, tauxCible) {
	if (tauxCible == null) {
		tauxCible = .5;
	}
	return getCapacité(entité) * tauxCible - entité.bikeNum;
};

getCapacité = function(entité) {
	return entité.slotNum || CAPACITÉ_CAMION;
};

getStation = function(camion) {
	return camion.currentStation || camion.destination;
};

getStationsEnnemis = function(monId, stations) {
	return stations.filter(function(e) {
		return e.owner && e.owner.id !== monId;
	});
};

getMesStations = function(monId, stations) {
	return stations.filter(function(e) {
		return e.owner && e.owner.id === monId;
	});
};

getStationsNeutre = function(stations) {
	return stations.filter(function(e) {
		return !e.owner;
	});
};

getStationsParTaille = function(stations, min, max) {
	if (min == null) {
		min = false;
	}
	if (max == null) {
		max = false;
	}
	return stations.filter(function(e) {
		var sélectionné;
		sélectionné = true;
		if (min && e.slotNum < min) {
			sélectionné = false;
		}
		if (max && e.slotNum > max) {
			sélectionné = false;
		}
		return sélectionné;
	});
};

getMesCamions = function(monId, camions) {
	return camions.filter(function(e) {
		return e.owner && e.owner.id === monId;
	});
};

getCamionsAdverses = function(monId, camions) {
	return camions.filter(function(e) {
		return e.owner && e.owner.id !== monId;
	});
};

getMonAutreCamion = function(camion, mesCamions) {
	var tab1;
	tab1 = mesCamions.filter(function(e) {
		return e.id !== camion.id;
	});
	return tab1[0];
};

getCamionsArrêtés = function(camions) {
	return camions.filter(function(e) {
		return e.currentStation;
	});
};

getCamionsEnMouvement = function(camions) {
	return camions.filter(function(e) {
		return e.destination;
	});
};

filtrerParTauxDeRemplissage = function(entités, tauxMin, tauxMax) {
	if (tauxMin == null) {
		tauxMin = false;
	}
	if (tauxMax == null) {
		tauxMax = false;
	}
	return entités.filter(function(e) {
		var sélectionné;
		sélectionné = true;
		if (tauxMin && e.bikeNum / getCapacité(e) < tauxMin) {
			sélectionné = false;
		}
		if (tauxMax && e.bikeNum / getCapacité(e) > tauxMax) {
			sélectionné = false;
		}
		return sélectionné;
	});
};

trierStationsParTaille = function(stations, croissant) {
	var triCroissant, triDécroissant;
	if (croissant == null) {
		croissant = false;
	}
	triCroissant = function(a, b) {
		return a.slotNum - b.slotNum;
	};
	triDécroissant = function(a, b) {
		return b.slotNum - a.slotNum;
	};
	if (croissant) {
		return stations.sort(triCroissant);
	} else {
		return stations.sort(triDécroissant);
	}
};

trierStationsParTempsDeTrajet = function(camion, stations, croissant) {
	var stationDeDépart, triCroissant, triDécroissant;
	if (croissant == null) {
		croissant = true;
	}
	stationDeDépart = getStation(camion);
	triCroissant = function(a, b) {
		return tempsTrajet(stationDeDépart, a) - tempsTrajet(stationDeDépart, b);
	};
	triDécroissant = function(a, b) {
		return tempsTrajet(stationDeDépart, b) - tempsTrajet(stationDeDépart, a);
	};
	if (croissant) {
		return stations.sort(triCroissant);
	} else {
		return stations.sort(triDécroissant);
	}
};

trierStationsParTailleEtTemps = function(camion, stations, pondérationTemps, pondérationTaille) {
	var stationDeDépart;
	if (pondérationTemps == null) {
		pondérationTemps = 1;
	}
	if (pondérationTaille == null) {
		pondérationTaille = 1;
	}
	stationDeDépart = getStation(camion);
	return stations.sort(function(a, b) {
		return (tempsTrajet(stationDeDépart, a) - tempsTrajet(stationDeDépart, b)) * pondérationTemps + (b.slotNum - a.slotNum) * pondérationTaille;
	});
};

différence = function(tableauHôte, tableauASoustraire) {
	return tableauHôte.filter(function(e) {
		return !tableauASoustraire.some(function(e2) {
			return JSON.stringify(e2) === JSON.stringify(e);
		});
	});
};

chargerAuPlus = function(camion, nombreVélo) {
	return charger(camion, Math.min(nombreVélo, maxChargeable(camion)));
};

déchargerAuPlus = function(camion, nombreVélo) {
	if (nombreVélo == null) {
		nombreVélo = 0;
	}
	return décharger(camion, Math.min(nombreVélo, maxDéchargeable(camion)));
};

charger = function(camion, nombreVélo) {
	if (nombreVélo == null) {
		nombreVélo = 0;
	}
	return construireOrdre(camion, 'load', camion.currentStation, nombreVélo);
};

décharger = function(camion, nombreVélo) {
	if (nombreVélo == null) {
		nombreVélo = 0;
	}
	return construireOrdre(camion, 'unload', camion.currentStation, nombreVélo);
};

rallierStation = function(camion) {
	return construireOrdre(camion, 'load', camion.currentStation, 0);
};

allerA = function(camion, station) {
	return construireOrdre(camion, 'move', station);
};

construireOrdre = function(camion, instruction, stationCible, quantité) {
	var ordre;
	if (quantité == null) {
		quantité = 0;
	}
	ordre = {
		truckId: camion.id,
		targetStationId: stationCible.id,
		type: instruction
	};
	if (instruction !== 'move') {
		ordre.bikeNum = quantité;
	}
	return ordre;
};

maxChargeable = function(camion) {
	return CAPACITÉ_CAMION - camion.bikeNum;
};

maxDéchargeable = function(camion) {
	return camion.bikeNum;
};

distanceEntre = function(p1, p2) {
	return Math.sqrt(Math.pow(p2.x - p1.x, 2) + Math.pow(p2.y - p1.y, 2));
};

tempsTrajet = function(stationDépart, stationArrivée) {
	var index, indexInversé;
	index = stationDépart.id + '_' + stationArrivée.id;
	indexInversé = stationArrivée.id + '_' + stationDépart.id;
	return indexTempsTrajet[index] || indexTempsTrajet[indexInversé] || 999999;
};
